contracts/ExpenseTracker.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.27;

contract ExpenseTracker {
    // enum for category of transaction
    enum Category {
        Expense,
        Saving,
        Investment
    }

    // enum for payment mode
    enum PaymentType {
        UPI,
        Cash,
        Card
    }

    struct Transaction {
        uint256 _id;
        uint256 _amount;
        Category _category;
        PaymentType _paymentType;
        uint256 _timestamp;
        string _description;
    }

    // mapping transactions and storing them by ID
    mapping(address => mapping(uint256 => Transaction)) private transactionsMap;
    mapping(address => uint256) private transactionsCountMap;
    uint256 private transactionID; // to keep the track of id;

    // event for logging the transactions
    event TransactionCreated(
        address indexed user,
        uint256 _id,
        uint256 _amount,
        Category _category,
        PaymentType _paymentType,
        uint256 timestamp,
        string _description
    );

    // Creating Transaction
    function createTransaction(
        uint256 amount,
        Category category,
        PaymentType paymentType,
        string calldata description
    ) external {
        transactionID++;
        transactionsCountMap[msg.sender] = transactionID;
        transactionsMap[msg.sender][transactionID] = Transaction({
            _id: transactionID,
            _amount: amount,
            _category: category,
            _paymentType: paymentType,
            _timestamp: block.timestamp,
            _description: description
        });
        emit TransactionCreated(
            msg.sender,
            transactionID,
            amount,
            category,
            paymentType,
            block.timestamp,
            description
        );
    }

    event TransactionUpdated(
        address indexed user,
        uint256 _id,
        uint256 _amount,
        Category _category,
        PaymentType _paymentType,
        string _description
    );

    function updateTransaction(
        uint256 id,
        uint256 amount,
        Category category,
        PaymentType paymentType,
        string calldata description
    ) external {
        Transaction memory transactionToUpdate = transactionsMap[msg.sender][
            id
        ];
        require(
            transactionToUpdate._id != 0,
            "No Transaction found with this ID"
        );
        transactionToUpdate._amount = amount;
        transactionToUpdate._category = category;
        transactionToUpdate._paymentType = paymentType;
        transactionToUpdate._description = description;

        emit TransactionUpdated(
            msg.sender,
            id,
            amount,
            category,
            paymentType,
            description
        );
    }

    function getAllTransactions() external view returns (Transaction[] memory) {
        uint256 transactionsCount = transactionsCountMap[msg.sender];
        uint256 validTransactionCount = 0;

        // First, calculate the number of valid transactions
        for (uint256 i = 1; i <= transactionsCount; i++) {
            if (transactionsMap[msg.sender][i]._id != 0) {
                validTransactionCount++;
            }
        }

        // Create an array of the appropriate size
        Transaction[] memory result = new Transaction[](validTransactionCount);
        uint256 index = 0;

        // Populate the result array with valid transactions
        for (uint256 i = 1; i <= transactionsCount; i++) {
            if (transactionsMap[msg.sender][i]._id != 0) {
                result[index] = transactionsMap[msg.sender][i];
                index++;
            }
        }

        return result;
    }

    function getTransactionById(
        uint256 transactionId
    ) external view returns (Transaction memory) {
        Transaction memory transaction = transactionsMap[msg.sender][
            transactionId
        ];
        require(transaction._id != 0, "No Transaction found with this ID");
        return transaction;
    }

    event DeleteTransaction(address indexed user, uint256 _id);

    function deleteTransaction(uint256 transactionId) external {
        Transaction memory transaction = transactionsMap[msg.sender][
            transactionId
        ];
        require(transaction._id != 0, "No Transaction found with this ID");

        delete transactionsMap[msg.sender][transactionId];
        emit DeleteTransaction(msg.sender, transactionId);
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.27;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

